export class Lecture {
	constructor(lecture) {
		this.id = lecture.id;

		this.name =
			lecture.classRoom.departmentCode +
			" " +
			lecture.classRoom.section +
			" " +
			lecture.classRoom.startYear +
			" " +
			"Batch";
		this.cousrename = lecture.classRoom.departmentCode;
	}
}
